lst = list(range(1, 1_000_000_000))def l_search(ls, val):    for i in range(val):        if ls[i] == val:            return iprint(l_search(lst, 456544))def b_search(ls, val):    low, high = 0, len(ls)    while low <= high:        mid = (low + high) // 2        if ls[mid] == val:            return mid        elif ls[mid] < val:            low = mid + 1        else:            high = mid - 1    return Noneprint(b_search(lst, 456544))